import { useReducer } from "react";




export default function UserPage({user}){
    return(
        <>
            <p>name:{user.name}</p>
            <p>email:{user.email}</p>
            <p>username:{user.username}</p>
            <p>bio:{user.bio}</p>

        </>
    )
}
